import React, { Component, useState, useEffect } from 'react';
import { Text, View, StyleSheet, Button, TouchableOpacity } from 'react-native';
import { NavigationContainer } from '@react-navigation/native';
import { createNativeStackNavigator } from '@react-navigation/native-stack';
import LogList from './LogPage_component/LogList';
import { ScrollView } from 'react-native';

//screens
import AddFood from './AddFood';

const BreakFast = [
    { key: 'item1', value: 'Eggs' },
    { key: 'item2', value: 'Orange Juice' },
];

const Lunch = [
    { key: 'item1', value: 'Rice' },
    { key: 'item2', value: 'Chicken' },
];

const Dinner = [
    { key: 'item1', value: 'Steak' },
    { key: 'item2', value: 'mash potato' },
];

const Snacks = [
    { key: 'item1', value: 'Peas' },
    { key: 'item2', value: 'Carrots' },
];



function LogPage({ navigation }) {
    return (
        <ScrollView contentContainerStyle={{ padding: 10 }}>
            <View style={{ flex: 1 }}>


                <Text style={[styles.Text]}>BreakFast</Text>
                <LogList data={BreakFast} />
                <View style={styles.button}><Button title={'Add Food'} onPress={() => navigation.navigate('AddFood')} /></View>

                <Text style={[styles.Text, { marginTop: 20 }]}>Lunch</Text>
                <LogList data={Lunch} />
                <View style={styles.button}><Button title={'Add Food'} titleStyle={{ fontSize: 50 }} /></View>

                <Text style={[styles.Text, { marginTop: 20 }]}>Dinner</Text>
                <LogList data={Dinner} />
                <View style={styles.button}><Button title={'Add Food'} titleStyle={{ fontSize: 50 }} /></View>

                <Text style={[styles.Text, { marginTop: 20 }]}>Snacks</Text>
                <LogList data={Snacks} />
                <View style={styles.button}><Button title={'Add Food'} titleStyle={{ fontSize: 50 }} /></View>

                

                <TouchableOpacity style={styles.AddFoodManually}>
                    <Text style={styles.buttonText}>Add</Text>
                </TouchableOpacity>



            </View>
        </ScrollView>

    );
}

const Stack = createNativeStackNavigator();

function StackNav() {
    return (

        <NavigationContainer independent={true}>
            <Stack.Navigator initialRouteName='LogPage' >
                <Stack.Screen name='LogPage' component={LogPage} options={{ headerShown: false }} />
                <Stack.Screen name='AddFood' component={AddFood} />
            </Stack.Navigator>
        </NavigationContainer>

    );

}




const styles = StyleSheet.create({
    Text:
    {
        fontWeight: 'bold',
        fontSize: 30,
        backgroundColor: 'white',
        padding: 10
    },

    Link:
    {
        fontWeight: 'bold',
        fontSize: 30,
        color: 'blue',
        marginLeft: 10,
        marginTop: 1,
        backgroundColor: 'white'
    },

    button:
    {
        alignItems: 'flex-start',
        backgroundColor: 'white',
        marginTop: 2,
    },

    // add addFood manully styling - start
    AddFoodManually: {
        justifyContent:'center',
        paddingTop:20,
        marginBottom:40,
        fontWeight: 'bold',
        fontSize: 20,
        backgroundColor: 'white',
        borderRadius: 50,
        width:'7%',
        height:'10%',
        alignContent:'center',
    },
    buttonText: {
        borderColor:'red',
        color: 'green',
        fontSize: 18,
        fontWeight: 'bold',
        textAlign:'center',
    }
    // add addFood manully styling - end


});

export default StackNav;
